import React from 'react'
import { useDispatch,useSelector } from 'react-redux';
import { increment,decrement,reset } from './components/counterSlice';
export default function Counter() {
  const counter=useSelector((data)=>data.counter.val)
  const dispatch=useDispatch()
  return (
    <div>
      <h1>le nomber est : {counter}</h1>
      <button onClick={()=>dispatch(increment(1))}>increment</button>
      <button onClick={()=>dispatch(decrement(1))}>increment</button>
      <button onClick={()=>dispatch(reset(1))}>reset</button>
    </div>
  )
}
